function Netflix(props){
    return(
        <div className="card">
        <img src={props.imgsrc} alt="Dark" />
        <div>
        <span> {props.title}</span>
        </div>
        <h1> {props.sname}</h1>
        <a href="https://mail.google.com/mail/u/0/?tab=rm&ogbl#inbox" target="_blank">{props.link}
        <button> Watch Now</button>
        </a>
        </div>
    );
}

export default Netflix;
